import { render } from 'react-dom';
import { Arrow } from 'react-konva';

class Flecha extends React.Component {

  render() {
    return (
      <Arrow
         x = {550}
         y = {50}
         points = {[5, 100, 40, 23, 250, 60, 300, 20]}
         pointerLength = {20}
         pointerWidth = {20}
         fill = {'black'}
         stroke = {'black'}
         strokeWidth= {9}
         draggable
      />
    );
  }
}

export default Flecha;
